import React from 'react';
import Project from './Project';

const ProjectsGrid = ({ projects }) => {
	return (
		<div className="projects-grid">
			{projects.map((project, i) => {
				return <Project project={project} key={i} />;
			})}
		</div>
	);
};

export default ProjectsGrid;
